We are excited to review your PR.

So we can do the best job, please check:

- [x] There's a descriptive title that will make sense to other developers some time from now. 
- [x] There's associated issues. All PR's should have issue(s) associated - unless a trivial self-evident change such as fixing a typo. You can use the format `Fixes #nnnn` in your description to cause GitHub to automatically close the issue(s) when your PR is merged.
- [ ] Your change description explains what the change does, why you chose your approach, and anything else that reviewers should know.
- [ ] You have included any necessary tests in the same PR.

This PR includes API for auto featurizer

usage
```csharp
// data, context

// infer column information from data
var pipeline = context.Auto().Featurizer(data, excludeColumnNames: new[] {"Label"})
                      .Append(context.Auto().BinaryClassification("Label");

// using auto().InferColumns
var columnInfo = context.Auto().InferColumn(data);
var pipeline = context.Auto().Featurizer(columnInfo.Columns, excludeColumnNames: new[]{"Label"})
...
```
